for N in range(1, 21):
    def is_pair_prime(pair):
        for i in range(2, min(pair) + 1):
            if min(pair) % i == 0 or max(pair) % i == 0:
                return False
        return True

    def is_partition(pairs, x):
        for pair in pairs:
            if pair[0] >= x and pair[1] >= x:
                return False
            elif pair[0] < x and pair[1] < x:
                return False
        return True

    def get_valid_pairs(N):
        valid_pairs = set()
        for a in range(1, N + 1):
            for b in range(a + 1, N + 1):
                if is_pair_prime((a, b)):
                    valid_pairs.add((a, b))
        return valid_pairs

    def get_partitions(pairs):
        partitions = set()
        for x in range(2, N + 1):
            if is_partition(pairs, x):
                partitions.add(x)
        return partitions

    pairs = get_valid_pairs(N)
    partitions = get_partitions(pairs)
    result = len(partitions) % 1000000000
    print(result)

