from typing import List

class Task:
    def __init__(self, start_time: int, base_priority: int, a: int, instructions: List[str]):
        self.start_time = start_time
        self.base_priority = base_priority
        self.current_priority = base_priority
        self.instructions = instructions
        self.resources = {}
        self.time_complete = -1

    def is_running(self, time: int):
        return self.start_time <= time and self.instructions

    def execute_next(self, time: int, task_list: List['Task']):
        if not self.is_running(time) or not self.instructions:
            return

        instruction = self.instructions.pop(0)
        action, resource_index = instruction[0], int(instruction[1:])

        if action == "C":
            self.time_complete = time + 1
        elif action == "L":
            if resource_index in self.resources or any(task.resources[resource_index] > self.current_priority for task in task_list if resource_index in task.resources):
                self.current_priority = max(self.current_priority, max(task.current_priority for task in task_list if resource_index in task.resources))
            else:
                self.resources[resource_index] = self.current_priority
        elif action == "U":
            if resource_index in self.resources:
                del self.resources[resource_index]
            else:
                self.current_priority = max(self.current_priority, max(task.current_priority for task in task_list if resource_index in task.resources))

